import React from "react";


const Header = () => {
    return (
        <div className = "bg-gray-200 p-4 shadow-md">
            <div  className = "container mx-auto">
                <img className = "mx-auto" src = "/logo_palpitebox.png" alt = "PalpiteBox" />
            </div>
        </div>
    )
}

export default Header;
